import{WorkExperienceRepository}from"../../repository/work-experience-repository.js";class ProgrammingLanguageExperienceGraphModel{getProgrammingLanguageExperience=()=>{const e=(new WorkExperienceRepository).getAll(),r={};for(const o of e){if(!o.programLanguage||0===o.programLanguage.length)continue;if(!o.period.from||!o.period.to)continue;const e=e=>{const r=e.split("-"),o=new Date(r[0],r[1],r[2]);return 365*o.getFullYear()+30*(o.getMonth()+1)+o.getDate()},n=e(o.period.from),g=e(o.period.to)-n;for(const e of o.programLanguage)r[e]||(r[e]=0),r[e]+=g}return r}}export{ProgrammingLanguageExperienceGraphModel};